import { useState } from 'react';
import { Box, Heading, TabNav, Text } from '@primer/react';

export function CodeSnippet() {
  const [edit, setEdit] = useState(false);

  return (
    <Box
      sx={{
        border: '1px solid',
        borderColor: 'border.default',
        borderRadius: 2,
        alignSelf: 'flex-start',
        width: '100%',
        maxWidth: '600px',
        overflow: 'hidden',
      }}
    >
      <Box
        sx={{
          borderBottom: '1px solid',
          borderColor: 'border.default',
          p: 3,
        }}
      >
        Get label
      </Box>
      <Box
        sx={{
          pt: 2,
          px: 3,
        }}
      >
        <TabNav
          aria-label='Main'
          sx={{
            marginBottom: '-1px',
          }}
        >
          <TabNav.Link
            href='#'
            selected
            sx={{
              bg: 'transparent !important',
            }}
          >
            Home
          </TabNav.Link>
          <TabNav.Link href='#'>Documentation</TabNav.Link>
          <TabNav.Link href='#'>Support</TabNav.Link>
        </TabNav>
      </Box>
      <Box
        sx={{
          bg: 'canvas.subtle',
          borderTop: '1px solid',
          borderColor: 'border.default',
          p: 3,
          fontSize: 1,
        }}
      >
        <pre>
          <Text sx={{ color: 'danger.fg' }}>curl </Text>
          <Text sx={{ color: 'accent.fg' }}>-L</Text>
          <Text sx={{ color: 'fg.default' }}> \</Text>
          <br />
          <Text sx={{ color: 'fg.muted' }}>
            {'  '}
            <Text sx={{ color: 'accent.fg' }}>-H</Text> "Accept:
            application/vnd.github+json"{' '}
            <Text sx={{ color: 'fg.default' }}>\</Text>
          </Text>
          <br />
          <Text sx={{ color: 'fg.muted' }}>
            {'  '}
            <Text sx={{ color: 'accent.fg' }}>-H</Text> "Authorization: Bearer
            YOUR-TOKEN" <Text sx={{ color: 'fg.default' }}>\</Text>
          </Text>
          <br />
          <Text sx={{ color: 'fg.muted' }}>
            {'  '}
            <Text sx={{ color: 'accent.fg' }}>-H</Text> "X-GitHub-Api-Version:
            2022-11-28" <Text sx={{ color: 'fg.default' }}>\</Text>
          </Text>
          <br />
          <Box
            sx={{
              display: 'flex',
            }}
          >
            <Text>http(s)://</Text>
            <Text
              sx={{
                color: 'red',
              }}
            >
              HOSTNAME
            </Text>
            <Text>/api/v3/repos/OWNER/REPO/commits</Text>
          </Box>
        </pre>
      </Box>
    </Box>
  );
}
